/**
* Problem statement: https://leetcode.com/problems/backspace-string-compare/
*
* This is perhaps the third-best algorithm for this problem. Two others are a stack-based approach
* and a two-pointer approach, respectively.
*
* I suspect that this algorithm compares favorably performance-wise, with a time complexity of O(M+N)
* and a space complexity of O(M+N) (due to storing the cleaned strings in their own variables). 
* The other two solutions have a superior space complexity at O(1).
*/

/**
 * @param {string} s
 * @param {string} t
 * @return {boolean}
 */
var backspaceCompare = function(s, t) {
    let s1 = getCleanedString(s);
    let s2 = getCleanedString(t);

    if (s1.length !== s2.length) return false;

    for (i = 0; i < s1.length; i++) {
        if (s1[i] !== s2[i]) return false;
    }
    return true;
};

/**
* Calculate backspaces and return cleaned string
*
* @param {string} str - A string that may contain alphanumerics and '#' characters representing backspaces
* @return {string} - A string that has had all backspaces and any characters backspaced removed; 
* superfluous backspaces are discarded.
**/
function getCleanedString(str) {
    let backspaceCount = 0;
    for (let i = str.length - 1; i >= 0; i--) {
        // If valid char but we've had at least one backspace, 
        // remove current char and decrement backspace backspaceCount
        if (backspaceCount > 0 && str[i] !== '#') {
            str = str.substring(0, i) + str.substring(i + 1);
            backspaceCount--;
        }
        
        // If current char is a backspace, remove it and increment backspaceCount
        if (str[i] === '#') {
            str = str.substring(0, i) + str.substring(i + 1);
            backspaceCount++;
        }
    }

    // If we have any unaccounted backspaces left at the end,
    // make sure to remove them from the front of the string
    if (backspaceCount > 0) {
        for (i = 0; i < str.length - 1; i++) {
            if (str[i] !== '#') break;
            str.substring(0);
        }
    }

    return str;
}

const ball = document.getElementById('ball');
const pad1 = document.getElementById('pad1');
const pad2 = document.getElementById('pad2');
const score1 = document.getElementById('score1');
const score2 = document.getElementById('score2');

var scores = [0, 0];
setText(score1, scores[0]);
setText(score2, scores[1]);

var d1a = 0;
var d1b = 0;
var d2a = 0;
var d2b = 0;
var d1 = 0;
var d2 = 0;
var enablePaddles = true;
var gameState = 'round-begin';
var lastPoint = Math.round(Math.random());

const settings = [];
settings.Keys = ['s', 'w', 'arrowdown', 'arrowup'];
settings.DeflectionMultiplier = 1;
settings.PaddleSpeed = 5;
settings.BallSpeed = 7;

var ballVel = [];
ballVel.x = 0;
ballVel.y = 0;
ballVel.dir = 0;
ballVel.speed = 0;

setup();
window.onload = function() {
	setup();

	setInterval(function() {
		updateGame();
		updatePaddles();
		updateBall();
	}, 10)
}

function updateGame() {
	setText(score1, scores[0]);
	setText(score2, scores[1]);
}

function setup() {
	pad1.style.left = '5%';
	pad1.style.top = '50%';
	pad2.style.left = '95%';
	pad2.style.top = '50%';
	d1a = 0;
	d1b = 0;
	d2a = 0;
	d2b = 0;
	d1 = 0;
	d2 = 0;

	setPos(ball, '50%', '50%');
	ballVel.x = 0;
	ballVel.y = 0;
	lastPoint = Math.round(Math.random());

	scores = [0, 0];
	setText(score1, scores[0]);
	setText(score2, scores[1]);
	
	gameState = 'round-begin';
}

document.onkeydown = function(e) {
	let key = e.key.toLowerCase();
	let update = false;
	
	if (key == settings.Keys[0]) {d1a = 1; update = true;}
	if (key == settings.Keys[1]) {d1b = -1; update = true;}
	if (key == settings.Keys[2]) {d2a = 1; update = true;}
	if (key == settings.Keys[3]) {d2b = -1; update = true;}
	if (update) updateDirs();
}

document.onkeyup = function(e) {
	let key = e.key.toLowerCase();
	let update = false;
	
	if (key == settings.Keys[0]) {d1a = 0; update = true;}
	if (key == settings.Keys[1]) {d1b = 0; update = true;}
	if (key == settings.Keys[2]) {d2a = 0; update = true;}
	if (key == settings.Keys[3]) {d2b = 0; update = true;}
	if (update) updateDirs();
}

function updateDirs() {
	if (!enablePaddles) return;
	if (gameState == 'round-begin') {
		ballVel.x = (2*lastPoint-1)*settings.BallSpeed;
	}
	gameState = 'playing';
	d1 = clamp(d1a + d1b, -1, 1);
	d2 = clamp(d2a + d2b, -1, 1);
}

function nextRound(winner) {
	d1 = 0;
	d2 = 0;
	enablePaddles = false;
	lastPoint = winner;
	
	ballVel = [x=0,y=0];
	gameState = 'round-end';
	setTimeout(function() {
		enablePaddles = true;
		updateDirs();
		if (scores[0] >= 7 || scores[1] >= 7) {
			setup();
		} else {
			gameState = 'round-begin';
		}
		ballVel.x = 0;
		ballVel.y = 0;
		
		setPos(ball, '50%', '50%');
		setPos(pad1, '5%', '50%')
		setPos(pad2, '95%', '50%')
	}, 2000);
}

function computeBounce() {
	if (gameState != 'playing') return;
	let x = getPos(ball).x;
	let y = getPos(ball).y;
	let bSize = getSize(ball).width;

	if (y <= 0 || y >= window.innerHeight-bSize/2) {
		setPos(ball, x, clamp(y, bSize/2 + 1, window.innerHeight-bSize/2 - 1));
		ballVel.y *= -1;
	}
	if (x <= 0) {
		scores[1]++;
		nextRound(1);
	}
	if (x >= window.innerWidth-bSize/2) {
		scores[0]++;
		nextRound(0);
	}

	//
	let p1pos = getPos(pad1);
	let p2pos = getPos(pad2);
	let p1size = getSize(pad1);
	let p2size = getSize(pad2);
	let padRange1 = [];
	padRange1.x = x <= p1pos.x + p1size.width/2 + bSize/2 && x >= p1pos.x;
	padRange1.y = y <= p1pos.y + p1size.height/2 && y >= p1pos.y - p1size.height/2;
	let padRange2 = [];
	padRange2.x = x >= p2pos.x - p2size.width/2 - bSize/2 && x <= p2pos.x;
	padRange2.y = y <= p2pos.y + p2size.height/2 && y >= p2pos.y - p2size.height/2;

	if (padRange1.x && padRange1.y) {
		ballVel.x *= -1;
		let yVel = (2*Math.random()-1) + d1*settings.BallSpeed/4;
		ballVel.y = clamp(yVel, -settings.BallSpeed, settings.BallSpeed);
		setPos(ball, clamp(x, p1pos.x+p1size.width/2+bSize/2, p2pos.x-p2size.width/2-bSize/2), y);
	}
	if (padRange2.x && padRange2.y) {
		ballVel.x *= -1;
		let yVel = (2*Math.random()-1) + d2*settings.BallSpeed/4;
		ballVel.y = clamp(yVel, -settings.BallSpeed, settings.BallSpeed);
		setPos(ball, clamp(x, p1pos.x+p1size.width/2+bSize/2, p2pos.x-p2size.width/2-bSize/2), y);
	}
}

function updateBall() {
	movePos(ball, ballVel.x, ballVel.y);
	computeBounce();
}

function updatePaddles() {
	let minLimit = getSize(pad1).height / 2;
	let maxLimit = window.innerHeight - minLimit;
	let curPos1 = getPos(pad1)
	let curPos2 = getPos(pad2)

	let newPos1 = clamp(curPos1.y + d1 * settings.PaddleSpeed, minLimit, maxLimit);
	let newPos2 = clamp(curPos2.y + d2 * settings.PaddleSpeed, minLimit, maxLimit);

	setPos(pad1, curPos1.x, newPos1);
	setPos(pad2, curPos2.x, newPos2);
}

function clamp(n, min = 0, max = 1) {
	if (n < min) return min;
	if (n > max) return max;
	return n;
}

function getSize(elem) {
	let cStyle = window.getComputedStyle(elem);
	let s = [];
	s.width = parseInt(cStyle.width);
	s.height = parseInt(cStyle.height);
	return s;
}

function setPos(elem, x, y) {
	elem.style.left = x;
	elem.style.top = y;
}

function movePos(elem, x, y) {
	let curX = getPos(elem).x;
	let curY = getPos(elem).y;
	let newX = curX + x;
	let newY = curY + y;
	setPos(elem, newX, newY);
}

function getPos(elem) {
	let cStyle = window.getComputedStyle(elem);
	let pos = [];
	pos.x = parseInt(cStyle.left);
	pos.y = parseInt(cStyle.top);
	return pos;
}

function setText(elem, txt) {
	elem.textContent = txt;
}

function map(n, a1, b1, a2, b2) {
	return (n - a1)/(b1 - a1) * (b2 - a2) + a2;
}

#include <stdio.h>
#include <stdlib.h>
#include <assert.h>

int* summation(const int* A, const int* B, int n) {
    int* C = malloc(n * n * sizeof(*C));
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            C[i * n + j] = A[i * n + j] + B[i * n + j];
        }
    }
    return C;
}

int* subtraction(const int* A, const int* B, int n) {
    int* C = malloc(n * n * sizeof(*C));
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            C[i * n + j] = A[i * n + j] - B[i * n + j];
        }
    }
    return C;
}

int* multiply(const int* A, const int* B, int n) {
    int* C = malloc(n * n * sizeof(*C));
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            C[i * n + j] = 0;
            for (int k = 0; k < n; k++) {
                C[i * n + j] += A[i * n + k] * B[k * n + j];
            }
        }
    }
    return C;
}

void splitMatrix(const int* A, int* A11, int* A12, int* A21, int* A22, int n) {
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            A11[i * n + j] = A[i * n + j];
            A12[i * n + j] = A[i * n + j + n];
            A21[i * n + j] = A[(i + n) * n + j];
            A22[i * n + j] = A[(i + n) * n + j + n];
        }
    }
}

int* mergeMatrix(const int* A11, const int* A12, const int* A21, const int* A22, int n) {
    int* A = malloc((n << 1) * (n << 1) * sizeof(*A));
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            A[i * n + j] = A11[i * n + j];
            A[i * n + j + n] = A12[i * n + j];
            A[(i + n) * n + j] = A21[i * n + j];
            A[(i + n) * n + j + n] = A22[i * n + j];
        }
    }
    return A;
}

int* strassenMultiply(int* A, int* B, int n) {
    if (n <= 64) {
        return multiply(A, B, n);
    }

    n >>= 1;

    int* A11 = malloc(n * n * sizeof(*A11));
    int* A12 = malloc(n * n * sizeof(*A12));
    int* A21 = malloc(n * n * sizeof(*A21));
    int* A22 = malloc(n * n * sizeof(*A22));

    int* B11 = malloc(n * n * sizeof(*B11));
    int* B12 = malloc(n * n * sizeof(*B12));
    int* B21 = malloc(n * n * sizeof(*B21));
    int* B22 = malloc(n * n * sizeof(*B22));

    splitMatrix(A, A11, A12, A21, A22, n);
    splitMatrix(B, B11, B12, B21, B22, n);

    int* P1 = strassenMultiply(summation(A11, A22, n), summation(B11, B22, n), n);
    int* P2 = strassenMultiply(summation(A21, A22, n), B11, n);
    int* P3 = strassenMultiply(A11, subtraction(B12, B22, n), n);
    int* P4 = strassenMultiply(A22, subtraction(B21, B11, n), n);
    int* P5 = strassenMultiply(summation(A11, A12, n), B22, n);
    int* P6 = strassenMultiply(subtraction(A21, A11, n), summation(B11, B12, n), n);
    int* P7 = strassenMultiply(subtraction(A12, A22, n), summation(B21, B22, n), n);

    int* C11 = summation(summation(P1, P4, n), subtraction(P7, P5, n), n);
    int* C12 = summation(P3, P5, n);
    int* C21 = summation(P2, P4, n);
    int* C22 = summation(subtraction(P1, P2, n), summation(P3, P6, n), n);

    return mergeMatrix(C11, C12, C21, C22, n);
}

int main() {
    int n;
    scanf("%i", &n);

    assert(__builtin_popcount(n) == 1);

    int* A = malloc(n * n * sizeof(*A));
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            scanf("%i", &A[i * n + j]);
        }
    }

    int* B = malloc(n * n * sizeof(*B));
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            scanf("%i", &B[i * n + j]);
        }
    }

    int* C = strassenMultiply(A, B, n);

    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            printf("%i ", C[i * n + j]);
        }
        putchar('\n');
    }
}

