bool checkSoBT3(int n)
{
  return (n >= 10 && n < 99 && n % 2 == 0 && n % 11 != 0);
}

void baiTap3()
{
  int n, a[100];
  printf("\nNhap so nguyen duong n: ");
  scanf("%d", &n);

  for (int i = 0; i < n; i++)
    a[i] = rand() % 100;
  printf("\nDanh sach cac so trong mang la:\n");
  for (int i = 0; i < n; i++)
    printf("%5d ", a[i]);

  printf("\nDanh sach cac so thoa man bai 3 la: \n");
  int dem = 0;
  for (int i = 0; i < n; i++)
    if (checkSoBT3(a[i]))
    {
      printf("%5d ", a[i]);
      dem++;
    }
  printf("\nTong so luong cac so so thoa man bai 3 la: %d", dem);
}

